  CONSTRAINT `FK_komplain_doskar_doskar_2` FOREIGN KEY (`ex_pic`) REFERENCES `doskar` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_komplain_doskar_proses` FOREIGN KEY (`proses_id`) REFERENCES `proses` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='Data komplain dari klien';
